import React from 'react';
import { Link } from 'react-router-dom';
// import { Button } from 'reactstrap';
//Styles
// import { Back, Wrapper, Content, Text } from './Home.styles';
import './Home.css';
//Video
import Background from '../../images/background.mp4';
//Components
import Header from '../Header/Header';


const Home = () => {


    return (
    <>
        <div className="background">
            <video autoPlay loop muted>
                <source src={Background} type='video/mp4' />
            </video>
        </div>
        <Header color={'var(--White)'} barColor={'var(--Lime)'}/>
        <div className="wrapper">
            <div className="content">
                <div className="text">
                    <h3 className="title">
                        <div className="slide1"><span className="title1">Field-Specific / Accurate / Rapid</span></div>
                    </h3>
                    <h1 className="slide2"><span className="title2">Professional Translation Services <br/>
                    & Digital Management Solutions</span></h1>
                    <Link to='/quote'><button className="contactBtn">quick quote</button></Link>
                </div>
            </div>
        </div>
    </>
    );
};

export default Home;
